import {useEffect, useState} from "react";
import axios from "axios";
import {Link} from "react-router-dom";

export default function AllPortfolioPage() {
  const [portfolios,setPortfolios] = useState([]);
  useEffect(() => {
    axios.get('/portfolios').then(response => {
      setPortfolios(response.data);
    });
  }, []);
  return (
    <div className="mt-8 grid gap-x-6 gap-y-8 grid-cols-2 md:grid-cols-3 lg:grid-cols-3">
      {portfolios.length > 0 && portfolios.map(portfolio => (
        <Link to={'/portfolio/'+portfolio._id}>
          <div className="bg-gray-500 mb-2 rounded-2xl flex">
          </div>
          <h2 className="font-bold">{portfolio.address}</h2>
          <h3 className="text-sm text-gray-500">{portfolio.title}</h3>
          <div className="mt-1">
            <span className="font-bold">${portfolio.price}</span> per day
          </div>
        </Link>
      ))}
    </div>
  );
}
